import React from 'react';
import FacebookLogo from '../src/images/facebook.png';

const handleHeaderLogoClick = () => {
    window.location.reload()
}

const Header = () => {
  return (
    <header className="instagram-header">
      <div className="header-logo">
      <img src={FacebookLogo} alt="Logo" />
      </div>
      <div className="search-bar">
        <input type="text" placeholder="Search" />
      </div>
      <div className="header-icons">
        {/* Add icons for notifications, messages, etc. */}
        {/* Example: */}
        <img src="notification-icon.png" alt="Notifications" />
        <img src="message-icon.png" alt="Messages" />
      </div>
    </header>
  );
};

export default Header;
